// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.9.0;

import "./Roles.sol";

contract Autodealer {
  using Roles for Roles.Role;

  event AutodealerAdded(address indexed _account);
  event AutodealerRemoved(address indexed _account);

  Roles.Role private autodealersList;

  constructor() public {
    autodealersList.addRole(msg.sender);
    emit AutodealerAdded(msg.sender);
  }

  ///@dev Modifiers for Autodealer.
  modifier onlyAutodealer() {
    require(isAutodealer(msg.sender));
    _;
  }
  /*-----------------------------*/

  ///@dev Autodealer Utility functions.
  function isAutodealer(address _account) public view returns (bool) {
    return autodealersList.hasRole(_account);
  }

  function addAutodealer(address _account) public onlyAutodealer {
    autodealersList.addRole(_account);
    emit AutodealerAdded(_account);
  }

  function removeAutodealer() public {
    autodealersList.removeRole(msg.sender);
    emit AutodealerRemoved(msg.sender);
  }
  /*-----------------------------*/

}
